import React from "react";

function Aboutus() {
    return(
        <>
        <div>
          <img className="girls-group" src="https://images.unsplash.com/photo-1612229693210-30e16029c415?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=870&q=80" alt="girls-group"/>
          <div class="carousel-caption d-none d-md-block">
        <h5 className="carousel-header">Girls movement</h5>
        <p className="carousel-text" >Aiming to keep more and more girls in school.</p>
      </div>
        </div>
        </>
    )
}

export default Aboutus;
